    data: |
      SELECT ALL + 80 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT NULL NOT BETWEEN - CAST ( - - col1 AS INTEGER ) - - col1 AND + + col0 * - - ( + col2 ) * + - ( - + col0 );
  - name: tab1

outputs:
  - name: q10544.out
    data: |
